const Filters = (props) => {
  if (props.searchByName===null){
    return(
    <section>El personaje que buscas no exite</section>)
  }else{
  return (
    <input
      className='search-name'
      type='text'
      name='name'
      value={props.searchByName}
      onChange={props.handleSearchByName}
    />
  );
};
}

export default Filters;
